VALUES ('3760083783630', 'Yakitoris nature & sésame pavot', 'Brochettes de saumon fumé nature 34,6% : _saumon_ Atlantique 98,5% (Salmo salar) - sel 1,5%. Brochettes de saumon fumé au sésame et au pavot 34,6% : _saumon_ Atlantique 93,1% (Salmo salar), graines de _sésame_ toastées 3,2%, graines de pavot bleu toastées 1,8%, sel 1,5%, coriandre. Sauce Teriyaki 15,4%: eau, sucre, sauce _soja_ 7,4% (eau, _soja_, _blé_, sel), pâte de gingembre, amidon transformé de maïs, sel, vinaigre, extrait de levure, huile de colza, gingembre, poivre, épaississants : E410, E412, E407, colorant: caramel ordinaire. Sauce au wasabi 15,4%: eau, _moutarde_ (eau, graines de _moutarde_, vinaigre, sel), huile de colza, condiment à base de raifort et wasabi 7,3% (raifort 93%, _moutarde_, wasabi japonais 1%, poudre de curcuma, colorant : E133), raifort 6,3% (racines de raifort, eau, acidifiant : acide citrique, conservateur : disulfite de sodium), vinaigre d\'alcool, jaune d\'_oeuf_ de poules élevées en plein air, sel, sucre, amidon modifié de pomme de terre, épaississant : gomme xanthane.', 'https://static.openfoodfacts.org/images/products/376/008/378/3630/front_fr.8.400.jpg', '9.9', '1.5', '0.7', '0.3', '', '22.9', '2.5', '0.984251968503937', '', '0');

