VALUES ('3760086158466', 'Mousse au chocolat', '2 MOUSSES AU CHOCOLAT SURGELÉES. : blancs d\'œufs liquides pasteurisés (blancs stabilisant : gomme xanthane), chocolat noir à 5070 de cacao (19%) ( ôte de cacao, sucre, beurre de : lécitkine de soja, arôme naturel de cacao, émulsifiant vanille) chocolat noir à 70% de cacao (19%) ( ôte de cacao, : lécitkine de SQia, sucre, eurre de cacao, émulsifiant arôme naturel de vanille), iaunes d\'œufs liquides sucrés pasteurisés Caunes (50%), sucre), beurre pasteurisé (7 % Contient : œufs, soia et lait.', 'https://static.openfoodfacts.org/images/products/376/008/615/8466/front_fr.8.400.jpg', '21.5', '14', '29.5', '22', '3.8', '7.9', '0.2', '0.078740157480315', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760086158473', 'Les Entremets Pâtissiers - Forêt Noire', 'Mousse façon chantilly (32,24 %) : _crème_ pasteurisée (_crème_, stabilisant : carraghénanes), sucre glace (sucre, antiagglomérant : amidon de maïs), extrait de vanille, gélifiant : carraghénanes Ganache au chocolat noir (25.87 %) : chocolat noir à 50 % de cacao 11 % (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de _soja_, arôme naturel de vanille), _crème_ pasteurisée (_crème_, stabilisant : carraghénanes),  jaune d\'ŒUF, sucre. Biscuit au cacao ( 16.17 %) : ŒUF entier, farine de BLÉ, sucre, eau, sirop de sucre inverti cristallisé, poudre de cacao 0,6 %, stabilisant : sorbitol, émulsifiant :  mono - et diglycérides d\'acides gras, GLUTEN de blé. Éclats d\'amarena (14,23 %) : cerise 6 %, sucre, sirop de glucose-fructose, eau, jus d\'amarena 0,1 %, colorant : anthocyanes, correcteur d‘acidité : acide citrique. arômes, conservateur : anhydride SULFUREUX. Sirop d\'imbibage (7,76 %) : sirop de sucre inverti, eau, extrait de vanille. Décors (3,63 %) : amarena (cerise 1,4 %, Sucre, sirop de glucose-fructose, jus d\'amarena 0,04 %, colorant : anthocyanes, acidiﬁant : acide citrique, arôme, conservateur : anhydride SULFUREUX), décor en chocolat (pâte de cacao, sucre. beurre de cacao, matière grasse LAITIÈRE anhydre, émulsifiant : lécithine de tournesol, arôme naturel de vanille, colorant : oxyde et hydroxyde de fer).', 'https://static.openfoodfacts.org/images/products/376/008/615/8473/front_fr.20.400.jpg', '19', '16', '35', '29', '1.4', '3.5', '0.08', '0.031496062992126', '', '0');

