VALUES ('3760087361346', 'Ecoidees Sucre De Coco Cannelle-vanille Bio - Sachet', 'une marque d\'Ecoidées@ Sucre de coco à la cannelle et à la vanille Le saviez-vous ? Le Sucre de Coco est un produit artisanal élaboré à potlir de sève de fleur de cocotier, fabriqué traditionnellement dans des pays tels l\'Indonésie ou les Philippines. Pour ce faire, le récoltant doit grimper en haut du cocotier, inciser la fleur et disposer un récipient en bambou dans lequel la sève va s\'écoulerelentement. Rprès cuisson, la mélasse est écrasée avec une noix de coco et cristallise naturellement. mélangé à la cannelle «Ethnoscience» réputée pour ses arômes extraordinaires et à de la poudre de gousses de vanille, la saveur de ce sucre est intense, suave et typée. Conseils d\'utilisation desserts, boissons chaudes et froides. Dégustez-le saupoudré dans les yaourts, fromages blancs, mueslis, crêpes, salades de fruits, sur les tartes ainsi que dans les cocktails. Sucre de sève de fleur de coco (l) (2) (cocos_j1Wifera) ln rédients 90070, cannelle 5%, poudre de gousses de vanille (l) 5%. issu de l\'agriculture biologique issu du commerce équitable des ingrédienlS dorigine agricole sont Sus du commerce équitable. Origine sucre : Indonésie. Ecoidées ,Sarl 2, rue Félix Dournag 67250 Soultz-sous-Forêts info.ecoidees@gmail.com www.ecoidees.com Poids net 300g • sucre de coco ) équitable : www.ecoidees.com', '', '2', '1', '5', '2', '6', '1', '0', '0', '', '1');

