VALUES ('3760087361711', 'EGraines De Chia Bio - Sachet', 'Ethnoscience@ une marque d\'Ecoidées  Le saviez-vous ? Originaire du Mexique, les graines de Chia (terme qui signifie « Force » riche en vitamine en E et fibres. Elles sont connues pour faire partie des « aliments d\'endu- rance » des Aztèques et tribus natives d\'Amérique du Sud. Digestes, elles se saupoudrent facilement dans tous les plats chauds ou froids, se réhydratent en constituant un gel mucilagineux ou se mangent à la cuillère. Conseils d\'utilisation ou du lait de coco. Rajouter à volonté quelques épices (cardamone en poudre, cannelle, etc), du sucre de coco, des morceaux de banane, poire ou mangue. Ingrédients Graines de Chia noires* (Salvia Hispanica L.)', '', '32', '3', '38', '0.5', '35', '20', '0.03', '0.0118110236220472', '', '1');

